import React from 'react';

export default function TopBar() {
    return (
        <>
            <Title></Title>
            <Menu></Menu>
        </>
    );
}

function Title() {
    return (
        <>
            <div>Name</div>
        </>
    )
}

function Menu() {
    return (
        <>
            <div>Phonology</div>
            <div>Grammar</div>
            <div>Lexicon</div>
        </>
    );
}
